package vetor_Aula;

public class Boxing {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//Wapper class: Object- Boolean(boolean)- Character(char)- Byte(byte)- Short(short)- Long(long)- Double(double) -Integer(int) 
		int x = 20;
		
		Object obj = x;
		int y = (int) obj;
		
	    Integer x1 = 20;
		
		Integer obj1 = x1;
		int y1 =  obj1;
		
		System.out.println(obj);
		System.out.println(y);
		System.out.println(y1);
	}

}
